import * as React from 'react';
import { Button, View, Text, Image, StyleSheet, TouchableHighlight, Alert } from 'react-native';
import { NavigationContainer } from '@react-navigation/native';
import { createStackNavigator } from '@react-navigation/stack';
import { SplashScreen } from 'expo';
import a from './assets/A.gif'; 



SplashScreen.preventAutoHide();
setTimeout(SplashScreen.hide, 6000);


function CategoriesScreen({ navigation }) {
  return (
    <View style={{ flex: 1, alignItems: 'center', justifyContent: 'center' }}>

      <Text>Put Categories Here</Text>

      <TouchableHighlight 
            onPress={() => { alert('Karel says "Woof Woof!"'); }}
       >
			<Image source={a} style={{ width: 305, height: 159 }} />

      </TouchableHighlight> 

      <Button
        title="Alphabets"
        onPress={() => navigation.navigate('Alphabets')}
      />

      <Button
        title="Planets"
        onPress={() => navigation.navigate('Planets')}
      />

    </View>
  );
}


function AlphabetsScreen({ navigation }) {
  return (
    <View style={{ flex: 1, alignItems: 'center', justifyContent: 'center' }}>
      <Text>Alphabets Screen</Text>
      <Button
        title="Go to Alphabets... again"
        onPress={() => navigation.push('Alphabets')}
      />
      <Button title="Go to Categories" onPress={() => navigation.navigate('Categories')} />
      <Button title="Go back" onPress={() => navigation.goBack()} />
    </View>
  );
}


function PlanetsScreen({ navigation }) {
  return (
    <View style={{ flex: 1, alignItems: 'center', justifyContent: 'center' }}>
      <Text>Planets Screen</Text>
      <Button
        title="Go to Planets... again"
        onPress={() => navigation.push('Planets')}
      />
      <Button title="Go to Categories" onPress={() => navigation.navigate('Categories')} />
      <Button title="Go back" onPress={() => navigation.goBack()} />
    </View>
  );
}

const Stack = createStackNavigator();

function App() {
  return (
    <NavigationContainer>
      <Stack.Navigator initialRouteName="Categories">
        <Stack.Screen 
        	name="Categories" 
        	component={CategoriesScreen}
        	options={{ title: 'Categories'}}
        />
        <Stack.Screen
        	name="Alphabets"
        	component={AlphabetsScreen}
        	options={{ title: 'Alphabets'}}
        />
        <Stack.Screen
        	name="Planets"
        	component={PlanetsScreen}
        	options={{ title: 'Planets'}}
        />
      </Stack.Navigator>
    </NavigationContainer>
  );
}

export default App;
